INSERT INTO `mulla_cat_exam_items` VALUES (1,1,1,'Biology Revision Exam ','Biology Revision Exam ','12/16/2020','12/16/2020',10,NULL,41,10,15,'[{\"question\":\"Organisms that belong to the kingdom monera are \",\"answers\":{\"A\":\"Unicellular and prokaryotic\",\"B\":\"Multicellular and prokaryotic\",\"C\":\"Unicellular and eukaryotic \",\"D\":\" Multicellular and  prokaryotic \"},\"corrects\":{\"A\":true,\"B\":false,\"C\":false,\"D\":false},\"explanation\":\"\"},{\"question\":\"One of the following Chordata is ectothermic\",\"answers\":{\"A\":\"Bird \",\"B\":\"Frogs \",\"C\":\"Fishes \",\"D\":\"Amphibians \"},\"corrects\":{\"A\":false,\"B\":true,\"C\":false,\"D\":false},\"explanation\":\"\"},{\"question\":\"Hearing in a fish done by ____________________\",\"answers\":{\"A\":\"Ear \",\"B\":\"Scale \",\"C\":\"Fin \",\"D\":\"Lateral line \"},\"corrects\":{\"A\":false,\"B\":false,\"C\":false,\"D\":true},\"explanation\":\"\"},{\"question\":\"Production of milk for young\\u2019s is the characteristics of _______________\",\"answers\":{\"A\":\"Mammals \",\"B\":\"Reptilians \",\"C\":\"Fishes \",\"D\":\"Amphibians \"},\"corrects\":{\"A\":true,\"B\":false,\"C\":false,\"D\":false},\"explanation\":\"\"},{\"question\":\"Which one of the following phyla shows more development than the others? \",\"answers\":{\"A\":\"Porifera \",\"B\":\"Coelenterata \",\"C\":\"Mollusca \",\"D\":\"Annelida \"},\"corrects\":{\"A\":false,\"B\":false,\"C\":true,\"D\":false},\"explanation\":\"\"},{\"question\":\"One is a dicot plan\",\"answers\":{\"A\":\"Maize \",\"B\":\"Wheat \",\"C\":\"Bean \",\"D\":\"Teff \"},\"corrects\":{\"A\":false,\"B\":false,\"C\":true,\"D\":false},\"explanation\":\"\"},{\"question\":\"One is abiotic factor\",\"answers\":{\"A\":\"Climate \",\"B\":\"Soil \",\"C\":\"water \",\"D\":\"All \"},\"corrects\":{\"A\":false,\"B\":false,\"C\":false,\"D\":true},\"explanation\":\"\"},{\"question\":\"Animals which live both in dry land and water are called ---------------\",\"answers\":{\"A