INSERT INTO `mulla_notices` VALUES (4,'21/03/2021','ሰርቶ ማሳያ','ማስታወሻ የተከበራችሁ የተማሪዎቻችን ወላጆች ሰርቶማሳያ ሦስት ለተማሪዎች ተሰጥቷል፡፡ በቀጣይ ሳምንት የሁለተኛው ሽፍትረቡዕ፤ የሁለተኛው የመጀመሪያው ሽፍት ደግሞ ሀሙስ ሰርቶ ማሳያቸውን አጠናቀው ይመልሳሉ፡፡ከመጋቢት 3እስከ 6 አጋማሽፈተናና ለ8ኛ ክፍል ተማሪዎች የመጀመሪያው ሞዴል ፈተናለ ግማሽቀናት ይሰጣል፡፡ ተማሪዎች ከወዲሁ በቂዝግጅት ማድረግ ይጠበቅባቸዋል እኛ ምአስፈላጊውን ነገር ሁሉ እያደረግንላቸው ነው፡፡ እርስዎም ለልጅዎ የተለመደውን ድጋፍና ክትትል ስለሚየደርጉ በጣምእ ናመሰግናለን፡፡',1,'2021-03-21 07:14:14','2021-03-21 07:14:14',NULL),(6,'03/27/2021','ለተማሪ ወላጆች/ሕጋዊ አሳዳጊዎች ','በልጆቻችሁ የፈተና ውጤት ላይ ውይይት እንዲሁም አጠቃላይ መረጃዎችን ከመለዋወጥ አኳያ አጭር ስልጠና ስላለ ዕሁድ መጋቢቲ 19 ቀን 2013ዓ.ም ጠዋት 3፡00 ሰዓት ላይ በዋናው ግቢ እንድትገኙልን በአክብሮት እንጠይቃለን፡፡',1,'2021-03-27 17:54:00','2021-03-27 17:54:00',NULL),(7,'03/09/2021','Pan Nation Academy Grade 8 1st model exam program','Pan Nation Academy Grade 8 1st model exam program Exam day Period Subject 1st day 1 Amharic 2 English Break 3 Maths 2nd day 1 Biology 2 Physics Break 3 Civics 3rd day 1 Chemistry 2 - Break 3 Social studies ማሳሰቢያ፡ ለፈተናው ሁለት ቀን የተጠ ',1,'2021-03-27 17:59:17','2021-03-27 17:59:17',NULL);
