INSERT INTO `mulla_quiz_items` VALUES (1,1,1,'chemistry Quiz 1','chemistry Quiz 1',12,NULL,12,10,'03/20/2021','03/23/2021',10,'[{\"question\":\"All of the following are ways of expressing quantitative expressions of a solution except:\",\"answers\":{\"A\":\"mass percent\",\"B\":\"dilute concentration \",\"C\":\"molarities\",\"D\":\"normality\"},\"corrects\":{\"A\":false,\"B\":false,\"C\":true,\"D\":false},\"explanation\":\"\"},{\"question\":\"The number of mole of a solute divided by volume of solution in liter is:\",\"answers\":{\"A\":\"mole fraction\",\"B\":\"molarity\",\"C\":\"normality\",\"D\":\"none\"},\"corrects\":{\"A\":true,\"B\":false,\"C\":false,\"D\":false},\"explanation\":\"\"},{\"question\":\"What volume of a 0.35N solution contains 4 equivalent of solute?\",\"answers\":{\"A\":\"1.14 L\",\"B\":\"11.4 L\",\"C\":\"0.7 L\",\"D\":\"0.35 L\"},\"corrects\":{\"A\":false,\"B\":true,\"C\":false,\"D\":false},\"explanation\":\"\"},{\"question\":\"Which of the following acid is found in our stomach?\",\"answers\":{\"A\":\"HCooH\",\"B\":\"HCl\",\"C\":\"H2SO4\",\"D\":\"HNO\"},\"corrects\":{\"A\":false,\"B\":false,\"C\":true,\"D\":false},\"explanation\":\"\"},{\"question\":\"Which of the following is not Arrhenius base? \",\"answers\":{\"A\":\"Nh3\",\"B\":\" NaoH\",\"C\":\"KoH\",\"D\":\"Ca(OH)2\"},\"corrects\":{\"A\":false,\"B\":false,\"C\":true,\"D\":false},\"explanation\":\"\"}]','1','2021-03-20 19:16:21','2021-03-20 15:10:04'),(2,1,1,'IT Quiz 1','IT Quiz 1',12,NULL,31,10,'03/20/2021','03/17/2021',15,'[{\"question\":\"Which of the following is not needed to connect to internet?\",\"answers\":{\"A\":\"computer \",\"B\":\"UPS\",\"C\":\"telephone line             \",\"D\":\"modem\"},\"corrects\":{\"A\":false,\"B\":false,\"C\":true,\"D\":false},\"explanation\":\"\"},{\"question\":\"_________________ is a network that works like the Internet but it is only available within a particular organization, not to the public.\",\"answers\":{\"A\":\"Internet\",\"B\":\"Intranet\",